import moment from "moment";

export class LogProcessModel{    
    constructor(instanceId=0,transactId=0,clientId=0,observations="",responsible="",
    processId=0,activityId=0,requestId="",requestStatus="",rejectionReason="", bpmModel) {
      this.instanceId=instanceId;
      this.transactId=transactId;
      this.clientId=clientId;
      this.observations=observations;
      this.responsible=responsible;
      this.processId=processId;
      this.activityId=activityId;
      this.requestId=requestId;
      this.requestStatus=requestStatus;
      this.rejectionReason=rejectionReason;
      this.date= moment().format("YYYY-MM-DD");
      this.statusDescription= "";
      this.requestStage= "";
      this.processBpmId= bpmModel;
      this.processBpmName= "fake_data";
      this.activityBpmId= "fake_data";
      this.activityBpmName= "fake_data";

      this.status=true;
    }
  }
